#include <stdio.h>
#include <stdlib.h>
#include <stdbool.h>

typedef struct Stack {
    char *palavra;
    char topo;
    int limite;
    int capacidade;
} Stack;

bool Push( Stack *pilha, char letra );
void Pop( Stack *pilha );
void comecaPilha( Stack *pilha );
void freePilha( Stack *pilha );

int maximumGain( char* s, int x, int y ) {
    int i = 0;
    Stack pilha, outraPilha;
    int soma = 0;

    comecaPilha( &pilha );
    comecaPilha( &outraPilha );

    if ( y > x ) {
        while ( s[i] != '\0' ) {
            if ( pilha.limite > 0 && pilha.topo == 'b' && s[i] == 'a' ) {
                Pop( &pilha );
                soma += y;
            } else {
                Push( &pilha, s[i] );
            }
            i++;
        }

        i = 0;

        while ( i < pilha.limite ) {
            if ( outraPilha.topo == 'a' && pilha.palavra[i] == 'b' ) {
                Pop( &outraPilha );
                soma += x;
            } else {
                Push( &outraPilha, pilha.palavra[i] );
            }
            i++;
        }
    } else {
        while ( s[i] != '\0' ) {
            if ( pilha.topo == 'a' && s[i] == 'b' ) {
                Pop( &pilha );
                soma += x;
            } else {
                Push( &pilha, s[i] );
            }
            i++;
        }

        i = 0;

        while ( i < pilha.limite ) {
            if ( outraPilha.topo == 'b' && pilha.palavra[i] == 'a' ) {
                Pop( &outraPilha );
                soma += y;
            } else {
                Push( &outraPilha, pilha.palavra[i] );
            }
            i++;
        }
    }

    freePilha( &pilha );
    freePilha( &outraPilha );

    return soma;
}

void comecaPilha( Stack *pilha ) {
    pilha->limite = 0;
    pilha->capacidade = 10;
    pilha->palavra = ( char * )malloc( sizeof( char ) * pilha->capacidade );
    pilha->topo = '\0';
}

void freePilha( Stack *pilha ) {
    if( pilha == NULL ) {
        return;
    }
    free( pilha->palavra );
}

bool Push( Stack *pilha, char letra ) {
    if ( pilha->limite >= pilha->capacidade ) {
        pilha->capacidade *= 2;
        char *nova_palavra = realloc( pilha->palavra, sizeof( char ) * pilha->capacidade );

        if ( nova_palavra == NULL ) {
            return false;
        }
        pilha->palavra = nova_palavra;
    }

    pilha->palavra[ pilha->limite ] = letra;
    pilha->limite++;
    pilha->topo = letra;

    return true;
}

void Pop( Stack *pilha ) {
    if ( pilha->limite == 0 ) {
        pilha->topo = '\0';
        return;
    }

    pilha->limite--;

    if ( pilha->limite > 0 ) {
        pilha->topo = pilha->palavra[ pilha->limite - 1 ];
    } else {
        pilha->topo = '\0';
    }

    if ( pilha->limite <= pilha->capacidade / 2 && pilha->capacidade > 10 ) {
        pilha->capacidade /= 2;
        char *nova_palavra = realloc( pilha->palavra, sizeof( char ) * pilha->capacidade );
        if ( nova_palavra != NULL || pilha->limite == 0 ) {
            pilha->palavra = nova_palavra;
        }
    }
}

int main() {
    char s[] = "";
    int x = 4;
    int y = 5;

    int result = maximumGain( s, x, y );

    printf( "%d\n", result );

    return 0;
}
